import React from "react";
import Card from "./card";
import {asphaltBall, basketBall, footyBall, grassBall, volleyBall} from "./img/export";

const CardList = () => {
    return(
        <div className="parent">
            {"basketBall".include(searchbox) ?
                <div className="zone">
                <Card ballType={basketBall} sport={"basketball"}/>
                </div>: <div></div>
            }
            { "futsal ball".include(searchbox) ?
               <div className="zone">
               <Card ballType={asphaltBall} sport={"futsal ball"}/>
               </div>:<div></div>
            }
            {"footyvolley ball".include(searchbox) ?
             <div className="zone">
             <Card ballType={footyBall} sport={"footyvolley ball"}/>
             </div>:<div></div>
             }
            {"volleyBall".include(searchbox) ?
               <div className="zone">
               <Card ballType={volleyBall} sport={"volleyBall"}/>
               </div>:<div></div>
            }
            { "soccer ball".include(searchbox) ?
              <div className="zone">
              <Card ballType={grassBall} sport={"soccer ball"}/>
              </div>:<div></div>
            }
                    </div>

    );
}
export default CardList;
